import React from "react";
import {Col, FormGroup, Label, Modal, ModalBody, ModalHeader} from "reactstrap";
import Translate from "../../../Translate";

const CurrencyModal = props => {

    return (
        <Modal isOpen={props.isOpen}>
            <ModalHeader>
                <Translate name={'editCurrency'}/>
            </ModalHeader>
            <ModalBody>
                <form>
                    <FormGroup row>
                        <Label for={'name'} sm={3}>
                            <Translate name={'name'}/>
                            <Col sm={7} className={'pr-0'}>
                                <input
                                    id={'name'}
                                    type={'text'}
                                    className='form-control'
                                />
                            </Col>
                        </Label>
                    </FormGroup>
                </form>
            </ModalBody>
        </Modal>
    )
}

export default CurrencyModal
